MathJax.Localization.addTranslation("scn","FontWarnings",{version:"2.7.9",isLoaded:!0,strings:{webFont:"MathJax sta adupirannu tipi di car\xE0ttiri scarricati di Internet p'ammmustrari la matim\xE0tica nta sta p\xE0ggina. Scarricari sti tipi si pigghia tempu, dunca sta p\xE0ggina si purr\xECa mpagginari cchi\xF9 viloci si li tipi di car\xE0ttiri p\xE2 matim\xE0tica f\xF9ssiru istallati direttamenti nt\xE2 cartella d\xEE car\xE0ttiri d\xFB t\xF2 sistema.",imageFonts:"MathJax sta adupirannu mm\xE0ggini comu tipi di car\xE0ttiri, mmeci di adupirari tipi di car\xE0ttiri lucali o scarricati d'Internet. Stu fattu renni la mpagginazzioni cchi\xF9 lenta d\xFB s\xF2litu, e quannu si stampa, la matim\xE0tica purr\xECa nun aviri la risuluzzioni china cunzintuta d\xE2 stampanti.",noFonts:"MathJax nun potti attruvari nu tipu di car\xE0ttiri bonu p'ammustrari la matim\xE0tica, e mancu sunnu dispun\xECbbili mm\xE0ggini fatti a tipi di car\xE0ttiri; pi chistu sta ripiegannu a l'adupirari li car\xE0ttiri Unicode, nt\xE2 spiranza chi lu t\xF2 browser \xE8 capaci d'ammustr\xE0rili. P\xF2 \xE8ssiri ca certi car\xE0ttiri nun sp\xF9ntanu boni, o nun sp\xF9ntanu propia.",webFonts:"Li cchi\xF9 d\xEE browser muderni pirm\xE8ttinu di scarricari li tipi di car\xE0ttiri d'Internet. Aggiurnannu lu t\xF2 browser (o canci\xE0nnulu) si purr\xECa migghiurari la qualit\xE0 d\xE2 matim\xE0tica ca veni ammustrata nta sta p\xE0ggina.",fonts:"MathJax po fari usu o d\xEE [tipi di car\xE0ttiri STIX](%1) o d\xEE [tipi di car\xE0ttiri TeX MathJax](%2). Sc\xE0rrica e istalla unu di sti tipi pi fari funziunari megghiu MathJax.",STIXPage:"Sta p\xE0ggina \xE8 pruggittata pi fari usu d\xEE [tipi di car\xE0ttiri STIX](%1). Sc\xE0rrica e istalla sti tipi pi fari funziunari megghiu MathJax.",TeXPage:"Sta p\xE0ggina \xE8 pruggittata pi fari usu d\xEE [tipi di car\xE0ttiri TeX MathJax](%1). Sc\xE0rrica e istalla sti tipi pi fari funziunari megghiu MathJax."}}),MathJax.Ajax.loadComplete("[MathJax]/localization/scn/FontWarnings.js");
